import { data } from './VeggiesData'
export default function DisplayViggies() {

  return (
    <>

    {
        data.map((items)=>

            <div className='displayImageWrap' key={items.id}>

            <img src={items.photo_url}/>
            <div className='dipslay-image-text' >

            <h1>Name:{items.name}</h1>

            </div>


            </div>
        )
    }

    </>
  )
}
